import Reacgt, {Component} from 'react';
import './App.css';

import Card from './components/card/Card';
import Navigation from './components/navigation/Navigation';
import Alert from './components/alert/Alert';

var list = [
];

for (let i=0; i<10; i++) {
  list[i] = {
    id: i,
    text: 'Button ' + (i+1)
  }
}

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {list: list};
  }
  render() {
    return (
      <div className="App bg-dark">
        <Navigation />

        <header className="App-header flex-column flex-lg-row bg-dark">
        { this.state.list.map(item => 
              <Card item={item}/>
        )}
        </header>
        <Alert />
      </div>
    );
  }
}

export default App;
